import React, { Component } from 'react';
import Header from './Header';
import Meta from './Meta';
import classlist from './style/page'
class Page extends Component {
    render() {
        return (
            <div>         
                <Meta />
                <Header />
                <div>
                {this.props.children}
                </div>              
            </div>
        );
    }
}

export default Page;
